css:
@-moz-document domain("qiita.com") {
/* HOME background */
.p-home {
	background:#232323;
	background-color:#232323                                        
}

.p-home_aside > .ra-UserList{
	background-color:#434343
}

.p-home_aside > .ra-TagList{
	background-color:#434343
}

/* MAIN background */
.p-home_main{
	background:#434343
}

.tr-ItemList_label, .ra-User_name, .ra-User_screenname, .ra-User_contribCount, .ra-Tag_name, .ra-Tag_postCount{
	color:white;
}

.ra-UserList_tabItem.is-active, .ra-TagList_tabItem.is-active{
	color:#ccc
}

.tr-Item_title, .ra-UserList_label, .ra-TagList_label{
	color:#dcdcdc;
}
.p-items_wrapper{
	background:#D8D8D8
}
.p-items_wrapper .p-items_article{
	background:#BBB
}
.p-items_container{
	background:#D5D5D5
}
.footer{
	background:#333
}
}
